INSERT INTO `markdowns` (`id`, `contentHtml`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '<p><strong>Bác sĩ Chuyên khoa II Đỗ Hùng Mạnh</strong></p>\n<p>Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng\nTừng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM\nBác sĩ nhận khám mọi độ tuổi\nKhám và điều trị</p>\n<ul>\n<li>Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai</li>\n<li>Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ</li>\n<li>Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi</li>\n<li>Viêm họng: Đau rát họng, hôi miệng, vướng họng</li>\n<li>Viêm Amidan: Sốt, đau họng, ngủ ngáy</li>\n</ul>\n<p>Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói\nViêm mũi VA: Ngạt mũi, ngủ ngáy\nViêm thanh quản: Khàn tiếng\nHạt xơ thanh quản: Khàn tiếng, hụt hơi\nDị vật đường thở: Khó thở</p>\n<ul>\n<li>Viêm đường phế quản: Ho, tức ngực, khó thở</li>\n<li>Hen phế quản: Ho, khó thở</li>\n<li>Viêm phổi: Sốt, ho, khó thở</li>\n<li>Nấm ống tai: Ngứa tai, ù tai</li>\n</ul>\n<p>Quá trình công tác\nHọc Chuyên khoa II tại bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2019 - 2022)\nBác sĩ điều trị, khoa Tai mũi họng, Bệnh viện Thống Nhất (2016 - 2022)\nHọc Cao học tại Bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2013 - 2015)\nQuá trình đào tạo\nBác sĩ Chuyên khoa II Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2022)\nThạc sĩ - Bác sĩ Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2015)\nBác sĩ Đa khoa, Đại học Y Dược TP. HCM (2011)\nChứng chỉ trong và ngoài nước\nChứng chỉ thính học cơ bản, Đại học Y dược TP. HCM (2016)\nChứng chỉ Nội soi chẩn đoán và phẫu thuật nội soi cơ bản Tai mũi họng, Đại học Y dược TP. HCM (2014)</p>\n', '**Bác sĩ Chuyên khoa II Đỗ Hùng Mạnh**\n\nHơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng\nTừng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM\nBác sĩ nhận khám mọi độ tuổi\nKhám và điều trị\n\n* Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai\n* Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ\n* Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi\n* Viêm họng: Đau rát họng, hôi miệng, vướng họng\n* Viêm Amidan: Sốt, đau họng, ngủ ngáy\n\nHội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói\nViêm mũi VA: Ngạt mũi, ngủ ngáy\nViêm thanh quản: Khàn tiếng\nHạt xơ thanh quản: Khàn tiếng, hụt hơi\nDị vật đường thở: Khó thở\n* Viêm đường phế quản: Ho, tức ngực, khó thở\n* Hen phế quản: Ho, khó thở\n* Viêm phổi: Sốt, ho, khó thở\n* Nấm ống tai: Ngứa tai, ù tai\n\nQuá trình công tác\nHọc Chuyên khoa II tại bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2019 - 2022)\nBác sĩ điều trị, khoa Tai mũi họng, Bệnh viện Thống Nhất (2016 - 2022)\nHọc Cao học tại Bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2013 - 2015)\nQuá trình đào tạo\nBác sĩ Chuyên khoa II Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2022)\nThạc sĩ - Bác sĩ Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2015)\nBác sĩ Đa khoa, Đại học Y Dược TP. HCM (2011)\nChứng chỉ trong và ngoài nước\nChứng chỉ thính học cơ bản, Đại học Y dược TP. HCM (2016)\nChứng chỉ Nội soi chẩn đoán và phẫu thuật nội soi cơ bản Tai mũi họng, Đại học Y dược TP. HCM (2014)', 'Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng Từng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM Bác sĩ nhận khám mọi độ tuổi Khám và điều trị', 2, NULL, NULL, '2024-05-19 13:08:07', '2024-05-31 23:57:15'),
(2, '<h3><strong>Thầy thuốc Ưu tú, Bác sĩ Cao cấp Hoàng Đình Lân</strong></h3>\n<ul>\n<li>Hơn 40 năm kinh nghiệm trong lĩnh vực Tiêu hóa - Hậu môn Trực Tràng</li>\n<li>Chuyên gia đầu ngành về Hậu môn Trực tràng</li>\n<li>Nguyên chủ nhiệm khoa Ngoại – Bệnh viện Y học Cổ truyền Trung ương</li>\n<li>Hiện nay, Bác sĩ đang là Phó chủ tịch Hội Hậu môn Trực tràng – Kiêm tổng thư ký Hội Hậu môn Trực tràng Việt Nam</li>\n<li>Bác sĩ nhận khám cho bệnh nhân từ 12 tuổi trở lên</li>\n</ul>\n<p><strong>Khám và điều trị Chẩn đoán và kết hợp các phương pháp điều trị từ đông y với tây y đạt kết quả cao cho các bệnh lý:</strong></p>\n<ul>\n<li>Bệnh trĩ nội độ 1,2,3,4</li>\n<li>Bệnh trĩ ngoại</li>\n<li>Bệnh trĩ hỗn hợp</li>\n<li>Dị vật hậu môn</li>\n<li>Rò hậu môn, ngứa hậu môn</li>\n<li>Nứt kẽ hậu môn, đại tiện ra máu, đại tiện khó</li>\n<li>Polip hậu môn, Apxe hậu môn</li>\n<li>Tư vấn dự phòng tái phát bệnh trĩ sau phẫu thuật hoặc phòng ngừa bệnh trĩ khi có nguy cơ cao như táo bón, tiêu chảy, nghề nghiệp</li>\n<li>Tư vấn chế độ sinh hoạt đề phòng nguyên nhân gây bệnh như: đứng lâu, ngồi nhiều, ăn uống không điều độ, lỵ, táo bón kéo dài</li>\n<li>Tư vấn chế độ tập thể dục, dinh dưỡng vệ sinh cá nhân, làm việc cũng như các thực phẩm bổ sung cho bệnh nhân bệnh lý hậu môn, trực tràng, bệnh trĩ nội – ngoại</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Bác sĩ chuyên khoa Tiêu hóa, Bệnh Viện Đa khoa Hồng Phát</li>\n<li>Ủy viên ban chấp hành – Tổng biên tập tạp chí đại trực tràng Việt Nam</li>\n<li>Nguyên chủ nhiệm khoa Ngoại – Bệnh viện Y học Cổ truyền Trung ương</li>\n<li>Nguyên Phó bí thư Đảng ủy – Bệnh viện Y học Cổ truyền Trung ương</li>\n<li>Nguyên Phó Giám đốc Bệnh viện Nam Á</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Phó chủ tịch Hội Hậu môn Trực tràng – Kiêm tổng thư ký Hội Hậu môn Trực tràng Việt Nam</li>\n</ul>\n<p><strong>Giải thưởng</strong></p>\n<ul>\n<li>Danh hiệu Thầy thuốc Ưu tú (2005)</li>\n<li>Giải thưởng Hải thượng Lãn ông của Bộ Y tế (2013)</li>\n</ul>\n', '\n### **Thầy thuốc Ưu tú, Bác sĩ Cao cấp Hoàng Đình Lân**\n\n* Hơn 40 năm kinh nghiệm trong lĩnh vực Tiêu hóa - Hậu môn Trực Tràng\n* Chuyên gia đầu ngành về Hậu môn Trực tràng\n* Nguyên chủ nhiệm khoa Ngoại – Bệnh viện Y học Cổ truyền Trung ương\n* Hiện nay, Bác sĩ đang là Phó chủ tịch Hội Hậu môn Trực tràng – Kiêm tổng thư ký Hội Hậu môn Trực tràng Việt Nam\n* Bác sĩ nhận khám cho bệnh nhân từ 12 tuổi trở lên\n\n**Khám và điều trị Chẩn đoán và kết hợp các phương pháp điều trị từ đông y với tây y đạt kết quả cao cho các bệnh lý:**\n\n* Bệnh trĩ nội độ 1,2,3,4\n* Bệnh trĩ ngoại\n* Bệnh trĩ hỗn hợp\n* Dị vật hậu môn\n* Rò hậu môn, ngứa hậu môn\n* Nứt kẽ hậu môn, đại tiện ra máu, đại tiện khó\n* Polip hậu môn, Apxe hậu môn\n* Tư vấn dự phòng tái phát bệnh trĩ sau phẫu thuật hoặc phòng ngừa bệnh trĩ khi có nguy cơ cao như táo bón, tiêu chảy, nghề nghiệp\n* Tư vấn chế độ sinh hoạt đề phòng nguyên nhân gây bệnh như: đứng lâu, ngồi nhiều, ăn uống không điều độ, lỵ, táo bón kéo dài\n* Tư vấn chế độ tập thể dục, dinh dưỡng vệ sinh cá nhân, làm việc cũng như các thực phẩm bổ sung cho bệnh nhân bệnh lý hậu môn, trực tràng, bệnh trĩ nội – ngoại\n\n**Quá trình công tác**\n* Bác sĩ chuyên khoa Tiêu hóa, Bệnh Viện Đa khoa Hồng Phát\n* Ủy viên ban chấp hành – Tổng biên tập tạp chí đại trực tràng Việt Nam\n* Nguyên chủ nhiệm khoa Ngoại – Bệnh viện Y học Cổ truyền Trung ương\n* Nguyên Phó bí thư Đảng ủy – Bệnh viện Y học Cổ truyền Trung ương\n* Nguyên Phó Giám đốc Bệnh viện Nam Á\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n* Phó chủ tịch Hội Hậu môn Trực tràng – Kiêm tổng thư ký Hội Hậu môn Trực tràng Việt Nam\n\n**Giải thưởng**\n* Danh hiệu Thầy thuốc Ưu tú (2005)\n* Giải thưởng Hải thượng Lãn ông của Bộ Y tế (2013)', 'Hơn 40 năm kinh nghiệm trong lĩnh vực Tiêu hóa - Hậu môn Trực Tràng\nChuyên gia đầu ngành về Hậu môn Trực tràng\nNguyên chủ nhiệm khoa Ngoại – Bệnh viện Y học Cổ truyền Trung ương', 3, NULL, NULL, '2024-05-19 16:47:47', '2024-06-03 21:21:45'),
(3, '<h3><strong>Tiến sĩ, Bác sĩ Lê Minh Châu</strong></h3>\n<ul>\n<li>40 năm kinh nghiệm trong lĩnh vực Sản phụ khoa, Vô sinh hiếm muộn nữ</li>\n<li>Nguyên Phó Trưởng khoa Khám Bệnh, Bệnh viện Phụ sản Trung ương</li>\n<li>Trưởng khoa Sản phụ khoa, Bệnh viện An Việt</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Mổ u xơ tử cung</p>\n</li>\n<li>\n<p>Mổ u nang buồng trứng</p>\n</li>\n<li>\n<p>Khám và điều trị lộ tuyến cổ tử cung</p>\n</li>\n<li>\n<p>Gỡ dịch thông vòi</p>\n</li>\n<li>\n<p>Polyp tử cung</p>\n</li>\n<li>\n<p>Viêm âm đạo, viêm cổ tử cung</p>\n</li>\n<li>\n<p>Vô sinh hiếm muộn</p>\n</li>\n<li>\n<p>Điều trị lạc nội mạc tử cung</p>\n</li>\n<li>\n<p>Sẹo xấu âm đạo</p>\n</li>\n<li>\n<p>Chỉnh sửa, phục hồi tầng sinh môn sau sinh</p>\n</li>\n<li>\n<p>Theo dõi nang trứng</p>\n</li>\n<li>\n<p>Điều trị rong kinh, rong huyết, tiền mãn kinh</p>\n</li>\n<li>\n<p>Theo dõi thai kỳ</p>\n</li>\n<li>\n<p>Khám vú và điều trị u vú lành tính bằng hút chân không (VABB)</p>\n</li>\n<li>\n<p>Phẫu thuật ung thư vú</p>\n</li>\n<li>\n<p>Theo dõi thai kì</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Phó Trưởng khoa Khám Bệnh tại Bệnh viện Phụ sản Trung ương</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Đại học Y Hà Nội (1982)</li>\n</ul>\n<p><strong>Sách và các công trình nghiên cứu, báo cáo khoa học</strong></p>\n<ul>\n<li>Tiến sĩ Lê Minh Châu tích cực tham gia nghiên cứu khoa học với nhiều đề tài khoa học đã được công bố như: “Nghiên cứu mối liên quan giữa chất lượng tinh trùng sau lọc rửa và tỉ lệ có thai bằng phương pháp bơm tinh trùng vào buồng tử cung”, “Bơm tinh trùng vào buồng tử cung…&quot;</li>\n<li>Tiến sĩ Châu cũng tích cực tham gia nghiên cứu khoa học đề tài cấp Bộ như đề tài “Đánh giá hiệu quả và tính an toàn của thuốc viên TADIMAX trong điều trị U xơ tử cung”,…</li>\n<li>Nghiên cứu hiệu quả điều trị khô âm đạo của viên uống SPACAPS ở phụ nữ tiền mãn kinh và mãn kinh…</li>\n<li>Bơm tinh trùng vào buồng tử cung: liên quan giữa tinh trùng và tỉ lệ có thai ở những cặp vô sinh do thiểu năng tinh trùng.</li>\n<li>Nghiên cứu hiệu quả của phương pháp bơm tinh trùng đã lọc rửa bằng kỹ thuật thang nồng độ vào buồng tử cung trong điều trị vô sinh tại Bệnh viện Phụ sản Trung ương.</li>\n</ul>\n', '\n### **Tiến sĩ, Bác sĩ Lê Minh Châu**\n\n* 40 năm kinh nghiệm trong lĩnh vực Sản phụ khoa, Vô sinh hiếm muộn nữ\n* Nguyên Phó Trưởng khoa Khám Bệnh, Bệnh viện Phụ sản Trung ương\n* Trưởng khoa Sản phụ khoa, Bệnh viện An Việt\n* Bác sĩ nhận khám mọi độ tuổi\n\n**Khám và điều trị**\n* Mổ u xơ tử cung\n* Mổ u nang buồng trứng\n* Khám và điều trị lộ tuyến cổ tử cung\n* Gỡ dịch thông vòi\n* Polyp tử cung\n* Viêm âm đạo, viêm cổ tử cung\n* Vô sinh hiếm muộn\n* Điều trị lạc nội mạc tử cung\n* Sẹo xấu âm đạo\n* Chỉnh sửa, phục hồi tầng sinh môn sau sinh\n* Theo dõi nang trứng\n* Điều trị rong kinh, rong huyết, tiền mãn kinh\n* Theo dõi thai kỳ\n\n* Khám vú và điều trị u vú lành tính bằng hút chân không (VABB)\n* Phẫu thuật ung thư vú\n* Theo dõi thai kì\n\n \n**Quá trình công tác**\n* Nguyên Phó Trưởng khoa Khám Bệnh tại Bệnh viện Phụ sản Trung ương\n\n**Quá trình đào tạo**\n* Tốt nghiệp Đại học Y Hà Nội (1982)\n\n**Sách và các công trình nghiên cứu, báo cáo khoa học**\n* Tiến sĩ Lê Minh Châu tích cực tham gia nghiên cứu khoa học với nhiều đề tài khoa học đã được công bố như: “Nghiên cứu mối liên quan giữa chất lượng tinh trùng sau lọc rửa và tỉ lệ có thai bằng phương pháp bơm tinh trùng vào buồng tử cung”, “Bơm tinh trùng vào buồng tử cung…\"\n* Tiến sĩ Châu cũng tích cực tham gia nghiên cứu khoa học đề tài cấp Bộ như đề tài “Đánh giá hiệu quả và tính an toàn của thuốc viên TADIMAX trong điều trị U xơ tử cung”,…\n* Nghiên cứu hiệu quả điều trị khô âm đạo của viên uống SPACAPS ở phụ nữ tiền mãn kinh và mãn kinh…\n* Bơm tinh trùng vào buồng tử cung: liên quan giữa tinh trùng và tỉ lệ có thai ở những cặp vô sinh do thiểu năng tinh trùng.\n* Nghiên cứu hiệu quả của phương pháp bơm tinh trùng đã lọc rửa bằng kỹ thuật thang nồng độ vào buồng tử cung trong điều trị vô sinh tại Bệnh viện Phụ sản Trung ương.', '40 năm kinh nghiệm trong lĩnh vực Sản phụ khoa, Vô sinh hiếm muộn nữ\nNguyên Phó Trưởng khoa Khám bệnh, Bệnh viện Phụ sản Trung ương\nTrưởng khoa Sản phụ khoa, Bệnh viện An Việt', 4, NULL, NULL, '2024-05-19 16:52:19', '2024-05-19 16:52:19'),
(4, '<h3><strong>Thạc sĩ, Bác sĩ Phạm Thị Quỳnh</strong></h3>\n<ul>\n<li>Nguyên Trưởng khoa Sản, Bệnh viện E</li>\n<li>Thạc sĩ Chuyên ngành Sản phụ, Đại học Y Hà Nội (2000)</li>\n<li>Tốt nghiệp Bác sĩ Y khoa tại Liên Xô</li>\n<li>Nhận khám từ 15 tuổi trở lên</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Khám thai và theo dõi thai kì</li>\n<li>Chẩn đoán trước sinh và quản lý thai</li>\n<li>Khám về điều trị các bệnh lý phụ khoa</li>\n<li>Điều trị lộ tuyến cổ tử cung, cắt polyp</li>\n<li>Soi cổ tử cung, lấy bệnh phẩm xét nghiệm</li>\n<li>Tư vấn phẫu thuật sản khoa</li>\n<li>Tư vấn các biện pháp kế hoạch hóa gia đình</li>\n<li>Tư vấn, chăm sóc sức khỏe sinh sản vị thành niên</li>\n<li>Khám và tư vấn sức khỏe tiền hôn nhân</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Bác sĩ Y khoa, Đại học Y Rostov sông Đông - Liên Xô cũ (1976 - 1982)</li>\n<li>Thạc sĩ Chuyên ngành Sản phụ, Đại học Y Hà Nội (2000)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa Sản, Bệnh viện E Hà Nội</li>\n</ul>\n', '\n### **Thạc sĩ, Bác sĩ Phạm Thị Quỳnh**\n* Nguyên Trưởng khoa Sản, Bệnh viện E\n* Thạc sĩ Chuyên ngành Sản phụ, Đại học Y Hà Nội (2000)\n* Tốt nghiệp Bác sĩ Y khoa tại Liên Xô\n* Nhận khám từ 15 tuổi trở lên\n\n**Khám và điều trị**\n* Khám thai và theo dõi thai kì\n* Chẩn đoán trước sinh và quản lý thai\n* Khám về điều trị các bệnh lý phụ khoa\n* Điều trị lộ tuyến cổ tử cung, cắt polyp\n* Soi cổ tử cung, lấy bệnh phẩm xét nghiệm\n* Tư vấn phẫu thuật sản khoa\n* Tư vấn các biện pháp kế hoạch hóa gia đình\n* Tư vấn, chăm sóc sức khỏe sinh sản vị thành niên\n* Khám và tư vấn sức khỏe tiền hôn nhân\n\n**Quá trình đào tạo**\n* Bác sĩ Y khoa, Đại học Y Rostov sông Đông - Liên Xô cũ (1976 - 1982)\n* Thạc sĩ Chuyên ngành Sản phụ, Đại học Y Hà Nội (2000)\n\n**Quá trình công tác**\n* Nguyên Trưởng khoa Sản, Bệnh viện E Hà Nội', 'Nguyên Trưởng khoa Sản, Bệnh viện E\nTốt nghiệp Bác sĩ Y khoa tại Đại học Y Rostov sông Đông - Liên Xô cũ \nNhận khám từ 15 tuổi trở lên', 5, NULL, NULL, '2024-05-19 16:55:48', '2024-05-19 17:01:49'),
